Ciudadanos suavizará sus exigencias ante PP y PSOE para evitar el bloqueo y la repetición de elecciones

Albert Rivera: "Pactar con los separatistas sería el punto final del PSOE"
Albert Rivera: "Quien no puede limpiar su casa no puede limpiar España"
Ir desde los extremos al centro. Desde posturas máximas a posturas de consenso. Es el camino que quiere recorrer Ciudadanos en las dos mesas de negociación que iniciará esta semana con PP y PSOE, ambas en paralelo. El partido de Albert Rivera es consciente que tendrá que ceder en sus planteamientos, ofrecer concesiones al bipartidismo, porque PP y PSOE también deberán renunciar a cosas. "Suavizaremos nuestras posiciones en todo aquellos que no constituya una amenaza ni para la igualdad ni unión de los españoles, así como para el proceso de integración en Europa. Dentro de ese marco, tenemos muy claro que hay que consensuar", ha explicado Juan Carlos Girauta, portavoz de Ciudadanos en el Congreso.
La formación emergente va a plantear como menú de la negociación cinco ejes: medidas económicas; políticas sociales; Europa y política exterior; regeneración y lucha contra la corrupción; y reforma de la Constitución. Es el punto de partida, con el punto de destino aún abierto. "Tendremos que renunciar a cosas como tendrán que renunciar los demás. Sería naif que explicara a qué estamos dispuestos a renunciar porque inmediatamente serían condiciones excluidas de la negociación", ha reflexionado Girauta. Eso sí, ha matizado: "Desde el sentido común se puede entender que no se puede ir a los máximos".
Por ejemplo, Ciudadanos plantea que los políticos tengan que abandonar su cargo en el momento en que resulten imputados. Ésa es la propuesta que trasladará a PP y PSOE. Sin embargo, "otros dicen que tiene que ser cuando se abra juicio oral. Intentaremos imponer nuestra visión, pero si hay otro momento en el que se concite la mayoría, pues lo veremos", ha defendido Girauta. 
Otro ejemplo: las medidas económicas. Ciudadanos plantea un contrato único y un complemento salarial para las rentas más bajas. Son dos de las medidas estrella de su programa. También es negociable. "Todo es una cuestión de grados. Iremos a maximizar, a reducir al máximo la dualidad del mercado laboral, para que si no podemos llegar al máximo nos acerquemos. Donde no se puede avanzar es cuando el otro quiere caminar en dirección contraria. Si se reducen contratos se reducirá la dualidad", es una de las hipótesis que ha lanzado Girauta. "Las cosas irrenunciables para nosotros las conoce todo el mundo: nunca jamás admitiremos que se ponga en duda la igualdad, la solidaridad y la unión de todos los españoles. No lo vamos a permitir, y como venimos avalados por los hechos en Cataluña somos creíbles".
Por tanto, es en la defensa de la unidad de España, del artículo 1 de la Constitución, la línea roja de Ciudadanos y lo que provoca su decisión de votar 'no' a cualquier acuerdo en el que esté implicado Podemos o los separatistas. Como contraposición, la formación naranja defiende que "hay coincidencias muy altas" entre PP, PSOE y Ciudadanos. "Es posible construir espacios comunes". "Estamos seguros de que a medida que se avancen contenidos en las negociaciones muchas cosas quedarán claras. Algunos de los vetos quedarán confirmados y otros se suavizarán. Seguro", ha vaticinado Girauta, cuyo partido, en los últimos días, insiste en tender la mano a Pedro Sánchez, vendiéndose como mejor socio de Gobierno que Podemos. Y aunque de manera oficial la psotura es que como máximo se abstendrán en un Gobierno del PP o el PSOE, Rivera prefiere no jugar a las promesas cuestionado sobre si de verdad nunca votará a favor.
